import TodoItem from "../TodoItem/TodoItem"

const TodoList = ({ todos = [], onDeleteTodo }) => {
  return (
    <ul className="list-group">
      {todos.map(item => (
        <TodoItem key={item.id} todo={item} onDeleteTodo={onDeleteTodo} />
      ))}
    </ul>
  )
}

export default TodoList
